import { BannerContainer, Avatar, Information } from "./styles";
import { Icons } from "asset/svg";
import ToolTip from "components/Tooltip";
interface IBannerProps {}

const Banner: React.FC<IBannerProps> = props => {
  return (
    <BannerContainer>
      <Information.Container>
        <Information.Greeting>Hi, I am</Information.Greeting>
        <Information.Name>Nguyen Nhat Lam</Information.Name>
        <Information.Career>Front-end Web Developer</Information.Career>
        <Information.Contact>
          <Information.Item>
            <Information.Icon>
              <Icons.EmailIcon />
            </Information.Icon>
          </Information.Item>
          <Information.Item>
            <Information.Icon>
              <Icons.FacebookIcon />
            </Information.Icon>
          </Information.Item>
          <Information.Item>
            <Information.Icon>
              <Icons.GithubIcon />
            </Information.Icon>
          </Information.Item>
          <ToolTip
            item={
              <Information.Item>
                <Information.Icon>
                  <Icons.PhoneIcon />
                </Information.Icon>
              </Information.Item>
            }
            text="070 3456 400"
          />
        </Information.Contact>
      </Information.Container>
    </BannerContainer>
  );
};

export default Banner;
